function Home() {
  return (
    <>
    <Navbar/>
    <div className="container">
      <div className="title">
        <h1>Ari </h1>
      </div>
      <div className="content">
        <div className="article">
          <h2>Hi Hello! Aari Embroidery Blouses  Expensive And Stylish , lehenga and bridel blouse On A Budget</h2>
          <p>We offer a large range and variety of Aari embroidery , so take a look at our extensive range of collections and where we focus on product design, delivery, and customer satisfaction.</p>
          <a href="Register" className="button">Register Now</a>
        </div>
        <div className="jaanu">
          <img src={hero}alt="my website" />
        </div>
      </div>
      <Footer/>
    </div>

    </>
  );
}

export default Home;
